import React from 'react';
import { ThemeProvider } from 'theme-ui'

import { Flex, Box } from 'reflexbox';

import theme from '../theme'

const Navigation = () => (
    <Flex justifyContent='space-between' fontFamily='body' variant='dark' p={3}>
        <Flex>
            <Box>
                <b>votsec</b>
            </Box>

            <Box>
            </Box>

            <Box>
            </Box>
        </Flex>
    </Flex>
);

const App = () => (
    <ThemeProvider theme={theme}>
        <Box height='100vh' variant='dark'>
            <Navigation />
        </Box>
    </ThemeProvider>
);

export default App;
